        if( (index >= IntType(0)) && (index < IntType(118)))
        {
            record_output_event( IntType(0) + index - IntType(0) , SpikeEmission(time_info.time_fixed) );
            
        }
        // Lets record!
        if( (index >= IntType(118)) && (index < IntType(236)))
        {
            record_output_event( IntType(118) + index - IntType(118) , SpikeEmission(time_info.time_fixed) );
            
        }

