    void calculate_electrical_coupling( NS_dINs::NrnPopData& src, NS_dINs::NrnPopData& dst)
    {
        

        for(GJList::iterator it = gap_junctions.begin(); it != gap_junctions.end();it++)
        {
            ScalarType<-28> curr = ScalarOp<-28>::mul(
                    ScalarOp<-2>::sub( src.V[get_value32(it->i)], dst.V[get_value32(it->j)] ),
                    it->strength_S_fixed
                );

            src.i_injected[get_value32(it->i)]  = ScalarOp<-28>::sub (src.i_injected[get_value32(it->i)], curr);
            src.i_injected[get_value32(it->j)] = ScalarOp<-28>::add (src.i_injected[get_value32(it->j)], curr);

        }

    }
